class Solution(object):
    def minSteps(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """
        
        sd, td = {},{}
        
        for i in s:
            if i in sd:
                sd[i]+=1
            else:
                sd[i]=1
        
        for i in t:
            if i in td:
                td[i]+=1
            else:
                td[i]=1
        
        bigdict ={}
        for i in sd:
            bigdict[i]=sd[i]
        
        for i in td:
            if i in bigdict:
                bigdict[i]= abs(bigdict[i]-td[i])
            else:
                bigdict[i]=td[i]
        return(sum(bigdict.values()))
        
print(Solution().minSteps("night","thing"))
print(Solution().minSteps("leetcode","coats"))
print(Solution().minSteps("" ,""))
